import React from 'react';
import './Attributes.css';
import Header from './Header/Header';
import Viewpoints from './Viewpoints/Viewpoints';

function Attributes() {
    return (
        <div>
            <div className="Heading">
                <Header />
            </div>
            
            <Viewpoints />
        </div>
    );
}

export default Attributes;
